s:4:\"type\";s:15:\"repository code\";s:5:\"value\";s:5:\"12345\";}i:2;a:2:{s:4:\"type\";s:21:\"Archivematica user pk\";s:5:\"value\";s:1:\"1\";}}}',619,'en'),('a:5:{s:4:\"type\";s:21:\"format identification\";s:8:\"dateTime\";s:20:\"2021-04-30T16:05:03Z\";s:7:\"outcome\";s:8:\"Positive\";s:17:\"outcomeDetailNote\";s:6:\"fmt/40\";s:22:\"linkingAgentIdentifier\";a:3:{i:0;a:2:{s:4:\"type\";s:19:\"preservation system\";s:5:\"value\";s:20:\"Archivematica-1.12.1\";}i:1;a:2:{s:4:\"type\";s:15:\"repository code\";s:5:\"value\";s:5:\"12345\";}i:2;a:2:{s:4:\"type\";s:21:\"Archivematica user pk\";s:5:\"value\";s:1:\"1\";}}}',620,'en'),('f0e904b5-3ffd-4aad-a0de-3f7428a6a53c',621,'en'),('69b91dfc-9130-4c4b-ba0e-56e8669d0fd5',622,'en'),('nderstanding Canada – Canadian Studies\nAPPLICATION FORM: Faculty Research Program\nSECTION A: PERSONAL INFORMATION\n\n(FRP)\n\n1. Full Name and Title: LAST NAME, First Name (Title)\nLAST NAME, First Name (Title)\n2. Gender : F\nM\n3. Addresses:\nHome\n\nEducational Institution\n\nHome Address\n\nInstitution Address\n\nTelephone: Home Telephone\n\nTelephone: Institution Telephone\n\nE-mail: Home E-mail\n\nE-mail: Institution E-mail\n\nCommunications about an award should be sent to: Home\n\nEducational Institution\n\n4. a) Academic Qualifications: Academic Qualifications\nb) Position (e.g. Professor): e.g. Professor\nc) Discipline and/or department within institution: Discipline/Department within institution\n5. Language Abilities*:\n\nEnglish\n\nFrench\n\nOral\nWritten\n* Please indicate proficiency with corresponding letters: Excellent, Good, Fair or Nil.\n6. Please provide a brief statement outlining your background field(s) of specialty and particular areas of\ninterest in Canadian Studies, and attach copies of your curriculum vitae and the list of your\npublications.\nBackground field(s), areas of interest in Canadian Studies\n\n7. Please list any awards previously received under this program or the Faculty Enrichment Program\n(FEP).\nProgram (FEP or FRP) and topic :\n\nDate of study visit in Canada (month/year):\n\nList Program (FRP or FEP) and topic\n\nList Date of study visit in Canada (month/year)\n\nFRP APPLICATION FORM: page 1 of 5\n\nSECTION B: RESEARCH PROPOSAL\n\n(FRP)\n\n1. Discipline in which research is to be undertaken: Discipline\n2. Research topic/title: Research topic/title\n\n3. Please attach a concise description of the proposed research project (2,000 words) which will a) identify the key\nissues or the main theoretical problems and the appropriate methodology of the research to be undertaken;\nb) indicate clearly both the nature and the scope of the project’s contribution to the literature in the chosen field and\nto the advancement of Canadian Studies in the applicant’s country of residence; and c) outline a general schedule\nof research activities.\n4. Summary of attached research proposal (not more than 100 words).\nSummary (100 words)\n\n5. Names of journals/publishers that may be willing to publish the final manuscript:\nJournals/Publishers\n\nSECTION C: REFERENCES\n\n(FRP)\n\nNames and addresses of two academics who have been asked to submit letters of recommendation on your\nbehalf direct to the Canadian Embassy by the deadline set for the competition. Letters of recommendation\nshould explain the referees’ professional relationship to the applicant and testify to the research ability of the\napplicant; the suitability of the research proposal as a contribution to the general body of literature in the field\nchosen; and its contribution to the advancement of Canadian Studies, particularly in the applicant’s country of\nresidence. (Referees may be contacted by the Canadian Embassy for additional comment, if necessary).\n1)\nAddress referee\n\n2)\nAddress referee\n\nFRP APPLICATION FORM: page 2 of 5\n\nSECTION D: BUDGET AND FUNDING SOURCES\n\n(FRP)\n\nPlease provide an itemized budget in Canadian currency:\nAnticipated Expenditures (see Value of Awards)\n\nAnticipated Income (see Terms and Conditions)\n\nDirect costs, such as:\nUse of equipment\nBooks & materials\nSecretarial services\nOther (specify):\n\n$CDN\n$CDN\n$CDN\n\nFinancial assistance requested\nunder this program\n\nOther\n\n$CDN\n\nIf applicable:\nInternational airfare\nto and from Canada\nLiving expenses\nwhile in Canada\n( # weeks @ $900Cdn)\nTotal\n\n$CDN\n\nOther funding sources*\nSpecify:\nOther sources\n\n$CDN\n\nOther sources\n\n$CDN\n\n$CDN\n\n$CDN\n\nTotal\n$CDN\n\n$CDN\n\n* Please indicate whether the other sources\nof funding are:\nin cash\nin kind\n\nIf travel to Canada is proposed, indicate:\n1) Reasons why travel to Canada is necessary for the purposes of the research project.\nExplain why travel to Canada is necessary\n\n2) Anticipated dates of departure and return (or date of termination of portion of trip supported by a\nFaculty Research Award):\nDeparture & Return\n\n3) Proposed program of visits in Canada, ensuring that access to relevant archives will be permitted:\nInstitution/Centre/lndividual\n\nLocation\n\nList Institutions/Centres/Individuals\n\nList Locations\n\nFRP APPLICATION FORM: page 3 of 5\n\nProposed dates\nList Proposed Dates\n\nSECTION E: ACCEPTANCE OF THE CONDITIONS OF AWARD\nFirst Name\n(Name, printed)\n\nI confirm that I,\n\n(FRP)\n, am a member\n\nof the academic or research staff at:\n\n(Name of higher education institution or research and policy planning institute)\n\nIf I am granted an award for the Canadian Studies publication purposes described in this application I agree:\na) to make all the necessary arrangements relating to the research project;\nb) to carry out the proposed research, for which I am personally responsible, and which is neither part\nof contractual or commissioned research, nor a part of my formal program of studies leading to a\ndegree and is not linked to the compilation of my PhD thesis;\nc) to provide two copies of a manuscript, of publishable quality and the length of a normal scholarly\njournal article, produced as a result of an award, and a one page summary thereof in English or\nFrench, not later than March 1 st of the financial year (April 1 to March 31) following the financial year\nin which the award was made;\nd) to make every attempt to publish the research on Canada;\ne) to complete and submit a “Final Instalment Claim Form” in order to receive the second and final\ninstalment of the award.\n\nI understand that, should my research project include a trip to Canada, medical insurance coverage while in Canada is\nmy personal responsibility.\n\n_______________________________________\nSignature of Applicant\n\n____________________________________\nDate\n\nFRP APPLICATION FORM: page 4 of 5\n\nFinal Installment CLAIM FORM\nCanadian Studies FRP Award\nFull name and address where second installment is to be sent:\n\nFirst Name:\n\nFirst Name\n\nLast Name:\n\nLast Name\n\nAddress:\n\nAddress\n\nTitle of article:\n\nTitle of article\n\nFRP awarded: (m/y):\n\nFRP awarded: (m/y)\n\nPlans/Prospects for the publication of the enclosed manuscript\n\nSubmitted and accepted for publication by (Publisher):\n\nPublisher\n\nIs this a refereed journal? (yes/no):\n\n(yes/no)\n\nDate of probable publication: (m/y):\n\nDate of probable publication (m/y)\n\nOR\nSubmitted and acceptation pending, to the following:\nPublisher:\n\nPublisher\n\nIs this a refereed journal? (yes/no):\nResponse expected (m/y):\n\n(yes/no)\n\nResponse expected (m/y)\n\nDocuments enclosed\n5\nArticle:\nCopies of relevant correspondence with publishers\nReport on research visit to Canada\nOther:\n\nSignature:\n\nOther Documents (list)\n\n___________________________\n\nDate: _______________________________\n\nFRP APPLICATION FORM: page 5 of 5\n\n',623,'en'),('a:5:{s:5:\"title\";s:15:\"EnFormFRPGenWEB\";s:6:\"author\";s:36:\"EnFormFRPGenWEB.doc - Microsoft Word\";s:9:\"pageCount\";s:1:\"5\";s:10:\"hasOutline\";b:1;s:8:\"hasForms\";b:1;}',624,'en'),('a:4:{s:4:\"name\";s:42:\"Acrobat PDF 1.6 - Portable Documen